INSERT INTO `teams` (`id`, `TeamLevel`, `ID1`, `Member1`, `ID2`, `Member2`, `ID3`, `Member3`, `ModusOperandi`) VALUES
	(77, '5*', 219, '5* Kitty Pryde', NULL, '5* Beta Ray Bill', 135, '4* Rocket and Groot', 'The current meta definer in PVP. Makes tons of special tiles and strengthens them rapidly. 4* Rocket is a common third.'),
	(78, '5*', NULL, '5* Thor', 104, '5* Okoye', NULL, '', 'Deals massive damage each turn once Thor is below his health threshold.'),
	(79, '5*', NULL, '5* Carnage', NULL, '5* Daredevil', NULL, '', 'An anti-Kitty team. Makes attack tiles for the other team, lets Kitty grow them, then steals them back.'),
	(80, '5*', 184, '5* Thanos', 195, '5* Black Panther', NULL, '', 'Thanos stuns BP to activate BP\'s passive attack.'),
	(81, '5*', NULL, '5* Gambit 3/5/5', 157, '5* Black Bolt', 144, '4* America Chavez', '(GamBolt) Black Bolt generates charged tiles for Gambit\'s red to destroy for AP and damage. America Chavez is a great third.'),
	(82, '4* and 5*', 219, '5* Kitty Pryde', 135, '4* Rocket and Groot', NULL, '', 'A speed team: R&G lay down strike tiles right off the bat, and Kitty improves them rapidly. Very common in PVP in 2019. '),
	(83, '4* and 5*', NULL, '5* Hawkeye', 41, '4* Agent Coulson', NULL, '', 'Makes tons of countdowns and the countdowns activate two passives. Great on defense too.'),
	(84, '4* and 5*', 201, '5* Spider-Man (Peter)', 87, '4* Miles Morales', NULL, '', 'Miles makes web tiles with yellow and purple for 5* Spidey to use.'),
	(85, '4* and 5*', NULL, 'Any 5*', 144, '4* America Chavez', NULL, '', 'Ridiculous critical damage. In PVE, have your best 5* wear a support item that increases the critical tile multiplier. (Critical tile supports include Kimoyo Beads, Sharon Carter, Stepford Cuckoos, all infinity stones.)'),
	(86, '4*', 179, '4* Gamora', 135, '4* Rocket and Groot', 27, '4* Medusa', 'Guardians member Gamora improves R&G\'s initial strike tiles. Stun, strike tiles, attack tiles. Medusa is a good third.'),
	(87, '4*', 56, '4* Carnage', 27, '4* Medusa', NULL, '', 'Cardusa: Put down a ton of special tiles quickly and get great bonuses whenever they are matched. (The definition of which tiles are considered matched in match-4s was changed in order to make this team less powerful.)'),
	(88, '4*', 156, '4* Shuri', 132, '4* Luke Cage', NULL, '', 'Shuri was designed to go with 4* Black Panther, but I say she\'s better with Luke against PVE minions. Once there are a lot of fortified special tiles out, Hero for Hire will deal massive damage for only 5 AP a pop. BP still works as a third as a source of fortified specials, and the sharing of yellow abilities is not a big deal due to Shuri\'s AP reduction.'),
	(89, '4*', 53, '4* Deadpool', 211, '4* The Thing', 145, '4* Bishop', 'Two characters that react to others taking damage. Thing can destroy a bunch of DP\'s CD tiles with Yancey Special. Bishop probably works in this role too.'),
	(90, '4*', 53, '4* Deadpool', 6, '4* Wolverine X-Force', NULL, '', 'Surgical Strike almost always targets DP\'s CD tiles.'),
	(91, '4*', 175, '4* Iron Fist', 132, '4* Luke Cage', NULL, '', 'They are designed to go together. Much better when at least one is boosted.'),
	(92, '4*', 138, '4* Nightcrawler', 91, '4* Professor X', NULL, '', 'Professor X (below Kurt\'s level). Get a purple-dominant board, cast Bamf to get purple match-5s for damage and purple AP.'),
	(93, '4*', 69, '4* Blade', 141, '4* Nico Minoru', NULL, '', 'Growing strike tiles. Luke Cage is good with Nico too.'),
	(94, '4*', 39, '4* Captain Marvel', 109, '4* Red Hulk', 128, '4* Valkyrie', 'Red Hulk\'s countdowns will make Cap Marvel strengthen A/P/S tiles. A reactive strike tile maker like Valkyrie is a good third.'),
	(95, '4*', 121, '4* Thor', 100, '4* Lockjaw', NULL, '', 'Tons of charged tiles for Thor\'s red.'),
	(96, '3* and 4*', 55, '4* Riri Williams', 63, '3* Ragnarok', NULL, '', 'The new \'Winfinite\' team: Rag turns red AP into blue tiles. Riri turns blue AP into red AP. It\'s best to have a red match set up before you cast Riri\'s blue. Many good choices for a third character.'),
	(97, '3* and 4*', 91, '4* Professor X', 21, '3* Black Widow', 25, '3* Scarlet Witch', 'The old \'Winfinite\' team, "Charlie\'s Angels": Prof. X (underleveled)'),
	(98, '3* and 4*', 91, '4* Professor X', 71, '3* Quicksilver', 24, '3* Iron Fist', 'Prof. X (underleveled) Use IF\'s purple to build enough black to use QS\'s black to make match-5s, for damage and black AP. Not as good on defense. IF can be replaced by Mystique for her blue and purple.'),
	(99, '3* and 4*', 121, '4* Thor', 5, '3* IM40', NULL, '', 'IM40 turns yellow AP into red and blue AP. Give it to Thor for stun and massive damage. Another charged tile maker like Lockjaw or Rag is a good third.'),
	(100, '3* and 4*', 39, '4* Captain Marvel', 67, '3* Steve Rogers', NULL, '', 'Get that red/blue AP back immediately for 5 yellow AP. Improves those protect tiles too.'),
	(101, '3* and 4*', 57, '4* Iceman', 59, '4* Nova', 5, '3* IM40', 'IM40 yellow generates Iceman\'s colors and red for Nova. Amazing stun and damage.'),
	(102, '3* and 4*', 6, '4* Wolverine X-Force', 61, '3* Magneto', 75, '3* Loki', 'Board shakes in every color as well as the passive. Somewhat low health. Loki can be replaced with Iron Fist.'),
	(103, '3* and 4*', 41, '4* Agent Coulson', 71, '3* Quicksilver', NULL, '', 'Two tile swap moves that gain AP. 5 different colors for active moves. Fun on offense, not so good on defense.'),
	(104, '3* and 4*', 87, '4* Miles Morales', 16, '3* Spider-Man', NULL, '', 'Make lots of web tiles with Miles to power up 3*\'s moves.'),
	(105, '3*', 24, '3* Iron Fist', 9, '3* Luke Cage', NULL, '', 'An excellent assortment of abilities.'),
	(106, '3*', 24, '3* Iron Fist', 62, '3* Gambit', NULL, '', 'Gambit\'s black makes purple charged tiles, IF\'s purple generates black tiles. Kamala Khan is a good third to heal the self-damage from Gambit.'),
	(107, '3*', 67, '3* Captain America', 5, '3* IM40', 80, '3* Hood 3/5/5', 'Use IM\'s yellow to generate AP for Steve. Use Hood\'s black to make everything faster. Good against invisibility tiles and Iron Fist.'),
	(108, '3*', 73, '3* Daken', 83, '3* Falcon', NULL, '', 'Make strike tiles quickly then improve them. Luke Cage or IF as a third.'),
	(109, '3*', 12, '3* Blade', 83, '3* Falcon', NULL, '', 'Make strike tiles quickly then improve them. Luke Cage or IF as a third.'),
	(110, '3*', 81, '3* Patch 5/3/5', 75, '3* Loki', NULL, '', 'Berserker Rage + Trickery will likely win the match. Great AP denial plus board shake for the strike tiles. Hood or a yellow/red/blue user as a third.'),
	(111, '3*', 81, '3* Patch 5/3/5', 17, '3* Doom', NULL, '', 'Doom\'s passive makes Berserker Rage not throw down as many enemy tiles.'),
	(112, '3*', 75, '3* Loki', 40, '3* Storm', NULL, '', 'A team based on AP dominance that is almost a \'winfinite\' team. Somewhat slow. Add 3* Hulk or a charged tile maker as a third.'),
	(113, '2*', 33, '2* Hawkeye', 49, '2* Magneto', NULL, '', 'Magneto\'s purple makes match-5s for Hawkeye\'s passive. 2* Bullseye\'s green can also help with match-5s. I like Storm as a third.'),
	(114, '2*', 29, '2* Black Widow', 32, '2* Daken', NULL, '', 'Black Widow\'s matching passive makes strike tiles count twice when it activates. Wolverine instead of Daken as well'),
	(115, '5*', 104, '5*Okoye', 146, '5*Hulk Immortal', NULL, NULL, 'Collect team-up AP, get huge passive damage every turn. America Chavez is a good third.'),
	(116, '4* and 5*', NULL, '5* Beta Ray Bill', 151, '4*Polaris', NULL, '', 'Tons of special tiles for Polaris\'s nuke. Very common in PVP (as of November 2020).'),
	(117, '4* and 5*', 146, '5*Hulk Immortal', 115, '4*Vulture', NULL, '', 'iHulk\'s resurrection doesn\'t take teammate health from airborne characters. If you can make 2 black AP every 3 turns, this is an invincible team. Great for PVE.');
